INSERT INTO `klh_berita` (`id`, `judul`, `isi`, `tgl_dibuat`) VALUES
(1, 'Masih Ada Pejabat\r\nTidak Peduli Lingkungan ', 'NUSA DUA BALI (Suara Karya): Menteri Lingkungan Hidup (LH) Balthasar Kambuaya mengatakan, masih ada pejabat yang belum punya komitmen untuk melakukan perlindungan dan pengelolaan lingkungan hidup yang baik.', '2011-11-26 11:20:27'),
(2, 'Dana alokasi khusus lingkungan hidup Rp479 miliar ', 'NUSA DUA: Kementerian Lingkungan NUSA DUA: Kementerian Lingkungan Hidup (KLH) mengalokasikan anggaran senilai Rp479,73 miliar melalui Dana Alokasi Khusus (DAK) yang akan disalurkan kepada 442 kabupaten/kota di seluruh Indonesia.\r\n\r\nMenteri Negara Lingkung', '2011-11-26 11:22:49'),
(3, 'Pemerintah Berupaya Maksimal Cegah Kerusakan Ozon', 'NUSA DUA - Kementrian Lingkungan Hidup terus melakukan upaya untuk mengatasi penipisan lapisan ozon. Salah satu upaya yang dilakukan adalah penegakan hukum kepada para perusahaan yang masih menggunakan Bahan Perusak Ozon (BPO) dalam bahan bakunya.\r\n \r\nDep', '2011-11-26 11:23:20'),
(4, 'Menteri: Pejabat Bukan Bekerja untuk Pengusaha', 'Nusa Dua - Menteri Lingkungan Hidup Balthasar Kambuaya mengingatkan para pejabat, tugas utama mereka bukanlah melayani para pengusaha atau perusahaan tetapi melayani rakyat Indonesia.\r\n\r\n"Kita bekerja untuk rakyat, dan bukannya untuk perusahaan", kata Kam', '2011-11-26 11:23:53'),
(8, 'Environmentally Sustainable City AWARD', 'Nusa Dua Bali, 23 November 2011, Kota-kota di negara ASEAN saat ini berada dalam berbagai tahap pembangunan, tetapi menghadapi satu masalah lingkungan yang serupa, yaitu; polusi udara dari industri dan kendaraan, kurangnya infrastruktur air limbah dan drainase, fasilitas serta manajemen pengelolaan sampah yang tidak memadai. Meskipun kota-kota di ASEAN telah memiliki  program yang bertujuan untuk mengatasi masalah ini dan meningkatkan kinerja pengelolaan lingkungan mereka, akan tetapi hal ini tidak sebanding dibandingkan dengan populasi, urbanisasi, industrialisasi dan pertumbuhan ekonomi yang terus meningkat.\n\nSebagai bentuk komitmen pelestarian lingkungan, Menteri Lingkungan Hidup se-ASEAN mendukung Environmentally Sustainable City (ESC) Program pada 4 Maret 2003 di Siem Reap, Kamboja dan mendirikan Kelompok Kerja untuk Kota Berwawasan Lingkungan (Working Group on Environmentally Sustainable City/AWGESC) dengan tujuan mengembangkan strategi dan rencana aksi.\n\nPada penyelenggaraan Workshop Sustainable Cities in ASEAN di Singapura pada tahun 2003, AWGESC telah mengembangkan konsep kerangka kerja Program Kota Berwawasan Lingkungan yang mengidentifikasi tujuan, strategi dan aktifitas untuk isu lingkungan : udara bersih (clean air), air bersih (clean water) dan kebersihan (clean land). Pada kesempatan itu pula, Indonesia mengusulkan pemberian penghargaan kepada kota yang menerapkan konsep berkelanjutan dengan mengacu pada program Adipura. Selanjutnya, dalam Workshop Pengembangan Indikator Kunci dan Penghargaan untuk Program Kota Berwawasan Lingkungan yang diselenggarakan pada bulan Desember 2005 di Jakarta, AWGESC telah mengembangkan kriteria untuk ketiga isu lingkungan tersebut sebagai dasar pemberian penghargaan.', '2011-12-06 00:18:26');
